import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
         <div className="App">
               <h1>Hello World!</h1>
        </div>
      </header>
    </div>
  );
}
const myelement = (
  <table>
    <tr>
      <th>Name</th>
    </tr>
    <tr>
      <td>John</td>
    </tr>
    <tr>
      <td>Elsa</td>
    </tr>
  </table>
);
export default App;
